import {useForm, useStep} from 'react-hooks-helper';

const defaultData ={
    firstName:"",
    lastName:"",
   nickName:"",
};

const steps=[
    {id:'names'},
    {id:'address'},
    {id:'contact'},
    {id:'review'},
    {id:'names'},
    
]

const MultiStepForm = () => {
    const [formData, setForm]= useForm(defaultData);
    const { step, navigation} = useStep({
        steps
    })
    return (
        <div>
            <h1>Student Form</h1>
        </div>
    )
}

export default MultiStepForm
